INSERT INTO content_contentnode VALUES('18250df2af1c46cb86c508108ffeee6d','Symmetry','c832439cf97154cf86b4c242e21b2ef2','Symmetry is an important geometrical concept, commonly exhibited in nature and is used almost in every field of activity. Artists, professionals, designers of clothing or jewelry, car manufacturers, architects and many others make use of the idea of symmetry. The beehives, the flowers, the tree-leaves, religious symbols, rugs, and handkerchiefs — everywhere you find symmetrical designs.',14.0,'','','topic',1,'SMTR SMTR AS AN AMPRT JMTR KMTR KNSPTT KMN AKSPT AN NTR ANT AS AS ALMST AN AFR FLT AF AKTFT ARTSTSS PRFSNLSS TSN TSKN AF KL0 KLT AR JLR ALR KR MNFKTRRSS ARKTKT ANT MN A0R ATR MK AS AF 0 T AT AF SMTR 0 T PHFSS 0 T FLRSS 0 T TRLFSS RLJ RLK SMPLSS RKSS ANT HNTKRXF HNTKRKF AFRR A FNT SMTR TSNSS TSKNSS',1913,1926,1,2,NULL,'4630819bc921494689e336defa2913f1');
