INSERT INTO content_contentnode VALUES('a9c341047ee043f2ae95315e942eb02b','Linear equations in one variable','68c786fc3d9f5f2a8a428444a71be5b4','Equations having variables with the highest power as ''1'' are called linear equations, for example 2x+7=3. Here the power of x is 1. In this chapter we will introduce the concept of equations with variables on both sides, and we will look into some applications for linear equations.',2.0,'','','topic',1,'LNR AKT AN AN FRPL AKXN HF FRPL A0 FT 0 T HHST PR AS AR KL LNR AKXNSS FR AKSMPL KSKSKSKSKSKS HR 0 T PR AF S AS AN 0S TS XPT A F AL FL ANTRTK 0 T KNSPT AF AKT A0 FT FRPL AN P0 PT STSS ANT A F AL FL LK ANT SM APLK FR LNR AKXNSS',1953,2008,1,2,NULL,'13decfaae14e47c5a6ddcc2da687c13d');
INSERT INTO content_contentnode VALUES('efb655da77164fffb38377f506163c38','Understanding quadrilaterals','6e992c336b335d0c87dc648ffe59230e','A quadrilateral is a four-sided polygon with four angles. There are many kinds of quadrilaterals. The five most common types are the parallelogram, the rectangle, the square, the trapezoid, and the rhombus. In this chapter we will learn about polygons, different types of quadrilaterals, and the special case of parallelograms!',3.0,'','','topic',1,'ANTRSTNT KTRLTR A KTRLTR AS A FRRST PLKN A0 FT FR ANKLSS 0R TR AR MN KNT AF KTRLTRLSS 0 T FF MST KMN TP AR 0 T PRLLKRMM 0 T RKTNKL 0 T SKR 0 T TRPSTT ANT 0 T RMPSS AN 0S TS XPTR A F AL FL LRN APT PLKNSS TFR TP AF KTRLTRLSS ANT 0 T SPSL SPXL KS AF PRLLKRMSS',2009,2056,1,2,NULL,'13decfaae14e47c5a6ddcc2da687c13d');
