INSERT INTO content_contentnode VALUES('224786e4ecd646c4971be30ec29b46c0','Angles: acute, obtuse, right and reflex','38049153e79558348e798f80bffff671','An angle smaller than a right angle is called an acute angle, an angle greater than right angle but less then straight angle is obtuse angle while a reflex angle is larger then a straight angle. I this chapter we will also learn how to categorize triangles based on the angles that it has.',1.0,'','','topic',1,'ANKLSS AKT APTS RT ANT RFLKS AN ANKL SML XML 0N TN A RT ANKL AS KL AN AKT ANKL AN ANKL KRT 0N TN RT ANKL PT LS 0N TN STRT ANKL AS APTS ANKL AL A RFLKS ANKL AS LRKR LRJR 0N TN A STRT ANKL A 0S TS XPT A F AL FL ALS LRN H HF T KTKR TRNKL PS AN 0 T ANKL 0T TT AT HSS',498,501,1,3,NULL,'934ffceff430497680516a3e92b4bf6e');
INSERT INTO content_contentnode VALUES('e9a104f3c3964893a098049534c40cd7','Measuring angles','4572fab63d375811b0d8f8a95acaa2c5','One complete revolution is divided into 360 equal parts. Each part is a degree, and angles are measured in degrees. A right angle is 90 degrees and a straight angle is 180 degrees. In this topic we will learn how to measure angles in degrees. We will also learn how to use a protractor and to solve for unknown angles.',2.0,'','','topic',1,'MSR ANKL AN KMPLT RFLT AS TFT ANT AKL PRTSS AX AK PRT AS A TKR ANT ANKL AR MSR AN TKRSS A RT ANKL AS TKR ANT A STRT ANKL AS TKRSS AN 0S TS TPK A F AL FL LRN H HF T MSR ANKL AN TKRSS A F AL FL ALS LRN H HF T AS A PRTRKTR ANT T SLF FR ANKNN ANKLSS',502,515,1,3,NULL,'934ffceff430497680516a3e92b4bf6e');
