INSERT INTO content_contentnode VALUES('848716828c564103ac5cd1608d3b218f','Quadrilateral types','f495c47ec35a5842808928ce93ee963f','Not all things with four sides and 90 degree angles are squares or rectangles! Sometimes the angles in these 4-sided shapes are less than (or greater than) 90 degrees, causing them to have a slightly odd shape. These are called quadrilaterals and come in a few different varieties. In this tutorial, you''ll learn about them.',4.0,'','','topic',1,'KTRLTR TP NT AL 0NK TNK A0 FT FR ST ANT TKR ANKL AR SKR AR RKTNKLSS SMTM 0 T ANKL AN 0S TS ST XP AR LS 0N TN R KRT 0NN TNN TKRSS KS 0M TM T HF A SLT XLT AT XP 0S TS AR KL KTRLTR ANT KM AN A F FF TFR FRTSS AN 0S TS TTRLL AL LRN APT 0MM TMM',528,541,1,3,NULL,'934ffceff430497680516a3e92b4bf6e');
INSERT INTO content_contentnode VALUES('b127a4c3d23943d381389d1e095cd242','Integers','263a026345315852946be9db1c1b87db','If we put the whole numbers and the negative numbers together, the new collection of numbers are called integers. In this topic we will learn how to depict negative numbers on a number line, ordering of negative numbers, and will introduce the concept of fractions on a number line.',1.0,'','','topic',1,'ANTJR ANTKR AF A F PT 0 T AL NMPR ANT 0 T NKT NMPR TK0RR TKTRR 0 T N NF KLKT AF NMPR AR KL ANTJRSS ANTKRSS AN 0S TS TPK A F AL FL LRN H HF T TPKT NKT NMPR AN A NMPR LN ARTR AF NKT NMPRSS ANT AL FL ANTRTK 0 T KNSPT AF FRKXN AN A NMPR LN',544,559,1,3,NULL,'a7abf8f60eea461ab710f6566e2261be');
