INSERT INTO content_contentnode VALUES('f7e76a05dae94aef80656191010ccbdf','Introduction','59c3448cb3465745bd9e047c59515d39','A fraction is a number representing part of a whole. We use fractions in everyday life, from dividing a to even checking the time. In this chapter we will learn about the basics of fractions, what proper, improper, equivalent, and mixed fractions are. We will also learn how to write fractions in their simplest forms, to compare fractions, and to add or subtract two fractions.',1.0,'','','topic',1,'ANTRTKT A FRKXN AS A NMPR RPRS PRT AF A AL A F AS FRKXN AN AFRT LF FRM TFT A T AFN XK 0 T TM AN 0S TS XPTR A F AL FL LRN APT 0 T PSK AF FRKXNSS AT PRPRR AMPRPRR AKFLNTT ANT MKS FRKXN AR A F AL FL ALS LRN H HF T RT FRKXN AN 0R TR SMPLST FRMSS T KMPR FRKXNSS ANT T AT AR SPTRKT T FRKXNSS',580,593,1,3,NULL,'a280650b428043128ba805cd78c28d61');
INSERT INTO content_contentnode VALUES('46888912fb614a77b440fe7d8ce47af5','A fraction','5ec20aa267b4591cae9d65f551dd71a6','5/12 is a fraction. We read it as “five-twelfths”.12 is the number of equal parts into which the whole has been divide, out of which we are talking about 5 only. In this topic we will learn ow to recognize a fraction, we will introduce the concept of numerators and denominators and we will learn how to compare fractions visually and using the number line.',2.0,'','','topic',1,'A FRKXN AS A FRKXNN A F RT AT AS FFTLF0SSSSS FFTLFTSSSSS AS 0 T NMPR AF AKL PRT ANT AX AK 0 T AL HS PN TFT AT AF AX AK A F AR TLK APT ANL AN 0S TS TPK A F AL FL LRN A AF T RKN RKKN A FRKXNN A F AL FL ANTRTK 0 T KNSPT AF NMR ANT TNMN ANT A F AL FL LRN H HF T KMPR FRKXN FSL ANT AS 0 T NMP LN',594,607,1,3,NULL,'a280650b428043128ba805cd78c28d61');
