INSERT INTO content_contentnode VALUES('d556670f601247b2af9666426ce3476c','Improper and mixed fractions','b78327bd876d535bbd82d1497471dc66','Fractions less than 1 are called proper fractions. In a proper fraction, the numerator is always less than the denominator. A mixed fraction is a combination of a whole and a part, while fractions greater than 1 are called improper fractions. In this topic we will learn about changing/converting mixed numbers into improper fractions and vice versa. We will also do exercises to convert decimals int',4.0,'','','topic',1,'AMPRP ANT MKS FRKXN FRKXN LS 0N TN AR KL PRPR FRKXNSS AN A PRPR FRKXNN 0 T NMR AS AL LS 0N TN 0 T TNMNTRR A MKS FRKT AS A KMPN AF A AL ANT A PRTT AL FRKXN KRTR 0N TN AR KL AMPRP FRKXNSS AN 0S TS TPK A F AL FL LRN APT XNJNKKKNFRT XNKNKKKNFRT MKS NMPR ANT AMPRP FRKXN ANT FS FRS A F AL FL ALS T AKSRSS T KNFRT TSM ANT',618,635,1,3,NULL,'a280650b428043128ba805cd78c28d61');
