INSERT INTO content_contentnode VALUES('330a4bb5eb9e428fbdf4f0873b2ce065','Comparing fractions','981efeab76495687983a28b85564b9af','In like fractions, the fraction having the greater numerator is greater. In fractions with same numerator, the fraction having the greater denominator is smaller. In this topic we will learn to compare fractions with different numerators and denominators. We will also learn about ordering fractions, multiplication as scaling, and compare probabilities.',8.0,'','','topic',1,'KMPR FRKXN AN LK FRKXNSS 0 T FRKXN HF 0 T KRT NMR AS KRTRR AN FRKXN A0 FT SM NMRTRR 0 T FRKT HF 0 T KRT TNMN AS SMLRR XMLRR AN 0S TS TPK A F AL FL LRN T KMPR FRKXN A0 FT TFR NMR ANT TNMNTRSS A F AL FL ALS LRN APT ARTR FRKXNSS MLTPL AS SKLNKK ANT KMPR PRPPLTSS',676,693,1,3,NULL,'a280650b428043128ba805cd78c28d61');
