INSERT INTO content_contentnode VALUES('efc107722f89480aa2baffa390f48d1d','Introduction','9c299cbf83a2566192cf5df5e1ad1ee6','A dot represents a decimal point. In real life problems like measuring of length, weight, or time, the values are not exact whole numbers, but rather portions of whole numbers. In situations where we need to be exact, we use decimal numbers. In this chapter we will learn how to reduce number to 10ths, 100ths of a decimal place, to compare decimal numbers. We will also learn how to add and subtract',1.0,'','','topic',1,'ANTRTKT A TT RPRS A TSM PNTT AN RL LF PRPLM LK MSR AF LNK00 LNKTT ATT FTT AR TM 0 T FL AR NT AKSKT AL NMPRSS PT R0R RTR PRXN AF AL NMPRSS AN STT AR A F N T P AKSKTT A F AS TSM NMPRSS AN 0S TS XPTR A F AL FL LRN H HF T RTK NMPR T 0SS TSS 0S TS AF A TSM PLSS T KMPR TSM NMPRSS A F AL FL ALS LRN H HF T AT ANT SPTRKT',766,769,1,3,NULL,'03e5d384e2fd4fde99d92dd2633e4c8c');
