INSERT INTO content_contentnode VALUES('a2aba7968f7c4fc29bd13af1fc5c6df7','Addition of decimals','7c3bee91e12a5c9d80dfbd73b5451bc0','To add decimals, we add them as though they are regular numbers, and then we place the decimal at its original position in the result. For example, 0.56 + 1.22 = 1.78. In this topic, we will practice a few problems of decimal addition to get a better understanding of this topic.',5.0,'','','topic',1,'ATT AF TSM T AT TSMLSS A F AT 0M TM AS 0 T 0 T AR RKLR NMPRSS ANT 0N TN A F PLS 0 T TSM AT AT ARJN ARKN PST AN 0 T RSLTT FR AKSMPL AN 0S TS TPKK A F AL FL PRKTK A F FF PRPLM AF TSM ATT T KT A PTR ANTRSTNT AF 0S TS TPKK',862,877,1,3,NULL,'03e5d384e2fd4fde99d92dd2633e4c8c');
