INSERT INTO content_contentnode VALUES('a1cf0cc7f1c54940a64c8df1bb637b0c','What an equation is','8560b610ad435591944b6a3941143d5b','The word ''equation'' is derived from the word ''equal''. An Equation is a statement which defines the equality between variables and constants. The addition, subtraction, multiplication, and division of a number on both sides does not disturb this equality. Here we will learn various forms of equation like ax=b, a/x=b. We also learn methods to solve an equation.',2.0,'','','topic',1,'AT AN AKT AS 0 T ART FRT AKT AS TRF FRM 0 T ART FRT AKLLL AN AKT AS A STTM AX AK TFN 0 T AKL PTN FRPL ANT KNSTNTSS 0 T ATXNN SPTRKXNN MLTPLKXNN ANT TFS AF A NMPR AN P0 PT ST T NT TSTRP 0S TS AKLT HR A F AL FL LRN FRS FRM AF AKT LK AKSKSPP AAKSKSPP A F ALS LRN M0T MTT T SLF AN AKXNN',1360,1395,1,3,NULL,'ba38e967c8d142eb94f19b16d8738d26');
