INSERT INTO content_contentnode VALUES('8be07d938e0144e1b1aa8285804cf490','Right angled triangles and Pythagoras property','8a469e7989a55c95836c0922666815ec','A right-angled triangle is the one in which the measure of one of the angles is 90 degrees. In a right-angled triangle, the square of the hypotenuse equals the sum of the squares of the other two sides. This is called Pythagorean Theorem. If the Pythagoras property holds, the triangle must be right-angled.',5.0,'','','topic',1,'RT ANKL TRNKL ANT P0KR PTKR PRPRT A RTTNKL TRNKL AS 0 T AN AN AX AK 0 T MSR AF AN AF 0 T ANKL AS TKRSS AN A RTTNKL TRNKL 0 T SKR AF 0 T HPTNS AKL 0 T SM AF 0 T SKR AF 0 T A0R ATR T STSS 0S TS AS KL P0KRN PTKRN 0RMM TRMM AF 0 T P0KR PTKR PRPRT HLTSS 0 T TRNKL MST P RTTNKLTT',1502,1517,1,3,NULL,'bff12202de6a4b15aff79e09288b42f3');
INSERT INTO content_contentnode VALUES('4f12f59c583144999353fe04f360544f','Pythagorean theorem proofs','894298c0cda25f1995569083863cd0f3','The Pythagorean theorem is one of the most famous ideas in all of mathematics.  This tutorial proves it.  Then proves it again... and again... and again.  More than just satisfying any skepticism of whether the Pythagorean theorem is really true (only one proof would be sufficient for that), it will hopefully open your mind to new and beautiful ways to prove something very powerful.
