INSERT INTO content_contentnode VALUES('636174e8c78f4f4b968c0fc645befd10','Converting decimals to percents: 0.601','a914ee54e4215c328793902281e59151','Percents can be written in decimal form. ​Per-cent means per-100. So, we divide the percent by 100 to get an equivalent decimal. Then, we remove the percent sign (%). For example, 65% can be converted to decimal form by solving 65÷100. So, 65%=0.65. Another way to think of dividing by 100 is moving the decimal two places to the left.',5.0,'','','video',1,'KNFRT TSM T PRSNTSS PRSNT KN P RTN AN TSM FRMM PRRSNT MN PRRRRRR S A F TFT 0 T PRSNT P T KT AN AKFL TSMLL 0NN TNN A F RMF 0 T PRSNT SN SKN FR AKSMPL KN P KNFRT T TSM FRM P SLF S AN0R ANTR A F T 0NK TNK AF TFT P AS MF 0 T TSM T PLS T 0 T LFTT',1577,1578,1,4,2,'70665f68e29c4a06a0c7f32e24a800f2');
