INSERT INTO content_contentnode VALUES('c56301318145445984fcacc2894e72bf','Converting percents to decimals: 59.2%','61f161529b0b5ed79d6407c0ce471024','Decimals can be written in percent form. ​Per-cent means per-100. So, we multiply the decimal by 100 to get an equivalent percent. Then, we add a percent sign (%). For example, 0.8 can be converted to percent form by solving 0.8✕100. So, 0.8=80%. Another way to think of multiplying by 100 is moving the decimal two places to the right.  ',9.0,'','','video',1,'KNFRT PRSNT T TSMLSS TSM KN P RTN AN PRSNT FRMM PRRSNT MN PRRRRRR S A F MLTPL 0 T TSM P T KT AN AKFL PRSNTT 0NN TNN A F AT A PRSNT SN SKN FR AKSMPL KN P KNFRT T PRSNT FRM P SLF S AN0R ANTR A F T 0NK TNK AF MLTPL P AS MF 0 T TSM T PLS T 0 T RTT',1585,1586,1,4,2,'70665f68e29c4a06a0c7f32e24a800f2');
