INSERT INTO content_contentnode VALUES('230bd05c7f0a43aaaaa0fb392aa5b790','Intro to long division of polynomials','96dce2f53a3a53768b4b710c63116be3','Any quotient of polynomials a(x)/b(x) can be written as q(x)+r(x)/b(x), where the degree of r(x) is less than the degree of b(x). For example, (x²-3x+5)/(x-1) can be written as x-2+3/(x-1). This latter form can be more useful for many problems that involve polynomials. The most common method for finding how to rewrite quotients like that is *polynomial long division*.',1.0,'','','video',1,'ANTR T LNK TFS AF PLNM AN KTNT AF PLNM AAKSKSKSPPKSKS KN P RTN AS KKKSKSKSRRKSKSKSPPKSKSKS AR 0 T TKR AF RRKSKS AS LS 0N TN 0 T TKR AF PPKSKSKS FR AKSMPL KSKSKSKSKSKSKSKSKSKSKSKSKSKS KN P RTN AS SKSKSKSKSKS 0S TS LT FRM KN P MR AS FR MN PRPLM 0T TT ANFLF PLNMLSS 0 T MST KMN M0T MTT FR FNT H HF T RRT KTNT LK 0T TT AS PLNM LNK TFSNNN TFXNNN',2625,2626,1,4,2,'87c799061d844f628ce729537c44b5fa');
